DROP TABLE IF EXISTS `ImplantMatrix`;
CREATE TABLE `ImplantMatrix` (
	`ID` INT NOT NULL PRIMARY KEY,
	`ShiningID` INT NOT NULL,
	`BrightID` INT NOT NULL,
	`FadedID` INT NOT NULL,
	`AbilityID` INT NOT NULL,
	`TreatQL1` INT NOT NULL,
	`AbilityQL1` INT NOT NULL,
	`TreatQL200` INT NOT NULL,
	`AbilityQL200` INT NOT NULL,
	`TreatQL201` INT NOT NULL,
	`AbilityQL201` INT NOT NULL,
	`TreatQL300` INT NOT NULL,
	`AbilityQL300` INT NOT NULL
);
CREATE INDEX shining_idx ON ImplantMatrix(ShiningID);
